        setValue(index)
        // console.log(index);        
    }

    function getInitianValue() {
        console.log(value);
        
    }

    setInitianValue();
   
    return <button className="square" onClick={getInitianValue}>{value}</button>
}


export default function Board() {
    return (
        <>
